import React from 'react';
import { Provider as PaperProvider, TextInput } from 'react-native-paper';
import { LoginScreen } from './app/screens/login/login.screen';
import { theme } from './App.style';

const App = () => {
  return (
    <PaperProvider theme={theme}>
      <LoginScreen/>
    </PaperProvider>
  );
  }

  export default App;
